import { useParams } from 'react-router-dom';
import '../assets/css/index.css';

import Data from '../data/ModuleData.js';

const { id } = useParams();

const Module = Data[id];

function App() {

  if (Module === undefined) {
    return (
      <h3></h3>
    )
  }

  return (
    <div className="App">
      <h1>{ id }</h1>
    </div>
  );
}

export default App;
